def binary_search(lists, target):
    lists = sorted(lists, key=lambda x: tuple(x))
    low = 1
    high = len(lists) - 1
    while low <= high:
        mid = (low + high) // 2
        mid_val = lists[mid]
        if mid_val == target:
            return True
        elif mid_val < target:
            low = mid + 1
        else:
            high = mid - 1
    return False

